  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Alfred Owen and GASTER, Alice
  WILLIAMS, Garth Gaster and VICKERS, Rhoda
  JWILLIAMS, Keith Colgate and GRAHAM, Lesley May
  WILLIAMS. Keith Colgate and GRAHAM, Lesley May (cont...)
  self-employed for nine years. He spent a short period in the logging industry in Papua New Guinea
  before, in 1974, setting up an importing business in the British Solomon Islands Protectorate where he
  also established a nail manufacturing plant. This business continues to operate with Lesley as company
  secretary and co-director.
  01> WILLIAMS, clare Gledhill m on 28.10.1974 to LITTLE, Craig John
  b 02.08.1948
  b 11.10.1947
  Clare b. at Palmerston North and m. at St Michael's Church, Remuera, Auckland.
  Divorced 1980. Clare now known by her maiden name. Craig, s/o John and Joan Little,
  b. at Auckland. Clare was a police officer (1969-77) and has been an Air New Zealand
  flight attendant since 1977.
  Craig started work with the newsroom staff of the New Zealand Broadcasting
  Corporation. He went to NZBC Announcers' Training School in Wellington and returned
  to Auckland to become a TV and radio announcer. In 1969 he did a year on Town and Around with Rhys
  Jones. In 1970 Town and Around became This Day (in Auckland) and Craig became front man for this
  programme and remained with it for 32 years. He hosted the first colour transmission in New
  Zealand and hosted the first satellite TV link up with another country. In 1974 he resigned from
  TV and radio work and worked for a year for the Owens Group, then started up on his own with the
  Conference Makers. In 1977 he joined Air Pacific for four years and for part of this time he lived
  in Fiji. He then started up his own communications and management consultancy.
  Refer to "The Scott Family. A Genealogy" published by Evagean Publishing in 1995 for records of
  Craig's family.
  02> WILLIAMS, Annette Gledhill m on 05.04.1969 to RASMUSSEN, Wayne John
  b 21.08.1949
  b 11.04.1947
  Annette b. at Palmerston North and m. at Rotorua. Wayne, s/o Bruce Rasmussen and Dawn Mere Dansey.
  Address: PO Box 719, Rotorua.
  Wayne is a logging contractor.
  01> RASMUSSEN, Christopher Michael
  b 24.03.1982
  Christopher b, at Rotorua.
  02> RASMUSSEN, Kate Elizabeth
  b 17.02.1984
  Kate b. at Rotorua.
  03> WILLIAMS, Christopher Keith m on 23.02.1974 to COLLINS, Diana Lesley
  b 08.10.1951
  b 18.07.1948
  Christopher b. at Pahiatua and m., at St Heliers, Auckland. Diana, d/o Ian George Turner Collins (b.
  17.07.1905 at Wanganui, d. 06.02.1985) and Francis Helen Swainson (b. 12.10.1917 at Pahiatua).
  Diana b. at Te Kuiti. Address: 12a Midway Avenue, Castor Bay, Auckland.
  Christopher was an Airforce officer until 1979 and is now an airline pilot with Air New Zealand,
  based in Auckland.
